import  React,{ Component } from "react";
import { Container, Navbar } from "react-bootstrap";

class VideoLists extends Component
{ 
    render() {
        return (
            <>
                <Container>
                <Navbar style={{backgroundColor:'aquamarine', width:'100%', height:'50px', top:''}}>
                        <Navbar.Brand >
                            <h1>Brand link</h1></Navbar.Brand>
  </Navbar></Container>
             </>
      )
  }

}

export default VideoLists;
